import React from 'react'
import ReactDOM from 'react-dom'

import {
    App, Time
} from './components'

function Nav() {
    return (
    <header className='nav'>
    <nav>
        <ul className="navbar">
            <li>Pricing</li>
            <li>About</li>
            <li>Contact</li>
        </ul>
    </nav>
    </header>
    )
}

function Main(){
    return (
        <>
        <h1>Reasons I'm excited to learn React</h1>
        <ul>
            <li></li>
            <li></li>
            <li></li>
        </ul>
        </>
    )
}

ReactDOM.render(
    //<div><App/><Time/></div>,
    <Nav />,
    document.getElementById('root')
)
